import React from 'react'
import { Card, CardActions, CardContent,Grid, CardMedia, Button, Typography } from "@material-ui/core";

const main = ({ news }) => {
    if(!news) return "Loading...";
     console.log(news.map(item => item.urlToImg))
    return (
        <div className="news-grid">
        {news.map((item) => (
           
               <div className="news-card">
                   <img src={item?.urlToImage} className="news-image" />
                   <h1>{item.source.name}</h1>
                   <p>{item.author}</p>
                   <p>{item.title}</p>
                   </div>
               
        ))}
        </div>
    )
}

export default main
